let count = IN[0];
let r = IN[1];
let points = [];

let angle = asin((2*r/count-r)/r);

let i = 0;
while i < count {
    let t = i * 1.0;               // 明示的に float 化
    let total = count * 1.0;       // float 版 count
    let z = (t / total) * 2.0 * r;
    let angle = asin((z - r) / r);
    let x = r * cos(angle);
    points.push([x, 0.0, z]);
    i += 1;
}

